import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
// import Movies from "./Components/Movies";
import MoviesHeading from "./Components/MoviesHeading";
import SearchBox from "./Components/SearchBox";
// import AddToFavorites from "./Components/AddToFavorites";

const API_KEY = "598d1c39"; // to OMDB
// const API_KEY = "338d9da5ffde4fe6044c0fd2c82d4457"; // to TMDB

const App = () => {
    useEffect(()=>{
        fetch('http://localhost:5001/', {mode: 'no-cors',
        method: "get", headers: {
            "Content-Type": "application/json"
       }});
    },[])

    function myFunc(){
        console.log("hey hey")
        fetch('http://localhost:5000/', {mode: 'no-cors',
        method: "get", headers: {
            "Content-Type": "application/json"
       }}).then(response => alert(response.json()))
    }
    return (
        <div className='first'>
            <MoviesHeading />
            <SearchBox />
            <button onClick={myFunc}>button</button>
        </div>
    )
};

export default App;
